    `,date:"May 15, 2025",time:"9:00 AM - 5:00 PM",location:"Grand Hyatt, Mumbai",format:"Hybrid",image:X("https://images.unsplash.com/photo-1515187029135-18ee286d815b?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2070&q=80"),speakers:[{name:"Rahul Sharma",role:"Head of Cybersecurity, Suviksan Technologies",avatar:X("https://randomuser.me/api/portraits/men/32.jpg")},{name:"Dr. Maya Patel",role:"CISO, Global Bank",avatar:X("https://randomuser.me/api/portraits/women/44.jpg")},{name:"Vijay Malhotra",role:"Security Researcher",avatar:X("https://randomuser.me/api/portraits/men/22.jpg")}],category:"Conference",registrationLink:"/events/register/1",tags:["Cybersecurity","Conference","Industry Experts","Networking"]},{id:2,title:"Cloud Innovation Workshop",description:"A hands-on workshop exploring advanced cloud deployment and security strategies.",content:`
