    `,date:"May 5, 2025",time:"10:00 AM - 4:00 PM",location:"Suviksan Technologies, Bangalore Office",format:"In-Person",image:X("https://images.unsplash.com/photo-1451187580459-43490279c0fa?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2072&q=80"),speakers:[{name:"Arun Kumar",role:"Cloud Solutions Architect, Suviksan Technologies",avatar:X("https://randomuser.me/api/portraits/men/28.jpg")},{name:"Neeta Singh",role:"DevOps Team Lead, Suviksan Technologies",avatar:X("https://randomuser.me/api/portraits/women/22.jpg")}],category:"Workshop",registrationLink:"/events/register/2",tags:["Cloud","Workshop","Hands-on","Security"]},{id:3,title:"Digital Transformation Roundtable",description:"An exclusive discussion on digital transformation challenges and success stories.",content:`
